import { createApp } from 'vue'
import Vue from "vue";
import App from './App.vue'

import VuePaginate from "vue-paginate";

createApp(App).mount('#app')

Vue.use(VuePaginate);

new Vue({
    render: h => h(App)
}).$mount("#app");
